a:260:{i:0;a:1:{s:2:"id";s:19:"2390943278818930028";}i:1;a:1:{s:10:"short_code";s:11:"CEuVj6MHC1s";}i:2;a:1:{s:12:"created_time";i:1599242671;}i:3;a:1:{s:7:"caption";s:1346:"Here is another image from my series exploring the inconsistency of textures, and the invisible stories they tell.

In my own eyes, this image feels like the sacrifice of martyrdom, or desire and defeat. It sounds like Chopin's Nocturn No.2 and smells like a dusty cave. It reminds me of humanity's struggle for a higher purpose, and the freedom of belonging

Would you believe the Original photos are from the grease stains on an old baking sheet and the cross section of a dried out log?

Originally I put these two subjects together simply because their textures were so different. While creating the image, i discovered there was actually a textural overlap where the baking sheet was unstained and the log was unbroken. This overlap became the fuzzy white light that highlights the detail of the textures, and provides context necessary for my to imprint my own interpretation. Considering these textural similarities represent the absence of a story in the two textures, this coincidence could perhaps be a comment on humanity's perception of purity, and the roll this plays in our pursuit of a higher purpose.

Thanks for reading! I'm curious - what was it about this image that made you want to read more about it?

